class Header extends Component {
  render() {
    return(
      <header>
        <h1>Set your Country, state and city to show your weather in real time!</h1>
        <form>
          <SelectCountry />
          {/* <SelectState />
          <SelectCity /> */}
          <button type="button" className="submitWeather">
            Show me Weather
          </button>
        </form>
      </header>
    )
  }
}

export default Header;
